(19, 1, '2020-12-18 16:30:48', '2020-12-18 15:30:48', 'Uteg je mo≈æda najsvestraniji od sve opreme za teretanu koja postoji. Doslovno mo≈æete raditi stotine razliƒçitih vje≈æbi s ovim ≈æeljeznim ≈°ipkama.\r\n\r\nUobiƒçajena tehnika kojom se koristi mrena je dobro dr≈æanje tijela i sprjeƒçavanje njihanja tijela; kako biste bili sigurni da va≈°e tijelo ostaje stabilizirano, kao na primjer kada radite vje≈æbe na teretani.\r\n\r\nBuduƒái da je lako prevariti i zamahnuti tijelom na koji god naƒçin olak≈°ajte vje≈æbu, upotreba mrene dolazi s oprezom: ozljede.\r\n\r\nKljuƒçno je odr≈æavati dobru formu prilikom izvoƒëenja vje≈æbi sa ≈°ipkom, posebno kada ih podi≈æete s tla i vraƒáate prema dolje, jer je u tom razdoblju rizik od ozljeda posebno velik!', 'Uteg', '', 'publish', 'closed', 'closed', '', 'uteg', '', '', '2021-01-18 15:35:02', '2021-01-18 14:35:02', '', 0, 'http://localhost/achilles_gym/?post_type=sprava&#038;p=19', 0, 'sprava', '', 0),
(20, 1, '2020-12-18 16:30:42', '2020-12-18 15:30:42', '', 'BARBELLS', '', 'inherit', 'open', 'closed', '', 'barbells', '', '', '2020-12-18 16:30:42', '2020-12-18 15:30:42', '', 19, 'http://localhost/achilles_gym/wp-content/uploads/2020/12/BARBELLS.png', 0, 'attachment', 'image/png', 0),
(21, 1, '2020-12-18 16:36:55', '2020-12-18 15:36:55', 'Kada izvodite benƒç, nemojte savijati leƒëa, to znaƒçi da su vam stopala postavljena prenisko. Poku≈°ajte ne odbiti ≈°ipku ni na prsima, iako mo≈æda mislite da zbog toga izgledate super maƒço.\r\n\r\nTakoƒëer, nemojte spu≈°tati letvicu prema vratu ili trbuhu jer bi vas moglo ozbiljno ozlijediti ako imate pretjeranu te≈æinu i gubite kontrolu, ƒçak i na trenutak.\r\n\r\nNapokon, poku≈°ajte ne zakljuƒçati laktove na vrhu pokreta, neka stopala, leƒëa i glava budu mirni!', 'Benƒç', '', 'publish', 'closed', 'closed', '', 'benc', '', '', '2021-01-16 22:25:26', '2021-01-16 21:25:26', '', 0, 'http://localhost/achilles_gym/?post_type=sprava&#038;p=21', 0, 'sprava', '', 0),
(22, 1, '2020-12-18 16:36:32', '2020-12-18 15:36:32', '', 'BENCH-PRESS', '', 'inherit', 'open', 'closed', '', 'bench-press', '', '', '2020-12-18 16:36:32', '2020-12-18 15:36:32', '', 21, 'http://localhost/achilles_gym/wp-content/uploads/2020/12/BENCH-PRESS.png', 0, 'attachment', 'image/png', 0),
(23, 1, '2020-12-18 16:39:37', '2020-12-18 15:39:37', 'Uobiƒçajene pogre≈°ke koje ljudi ƒçine prilikom vje≈æbanja s nagnutim bench pressom su: postavljanje klupe pod visokim nagibom (preko 50 stupnjeva), izvijanje leƒëa, odbijanje ≈°ipke od prsa i zakljuƒçavanje laktova.\r\n\r\nPoku≈°ajte izbjeƒái gornje pogre≈°ke dr≈æeƒái dobru formu i dr≈æeƒái nagib klupe ispod 50 stupnjeva.\r\n\r\nNapokon, va≈æan je polo≈æaj palca. Dr≈æite palicu palcima u suprotnosti s prstima, ovo je prirodnije dr≈æanje i sigurnije za podizanje.', 'Nagnuti benƒç', '', 'publish', 'closed', 'closed', '', 'nagnuti-benc', '', '', '2021-01-18 15:34:50', '2021-01-18 14:34:50', '', 0, 'http://localhost/achilles_gym/?post_type=sprava&#038;p=23', 0, 'sprava', '', 0),
