(25, 1, '2020-12-18 16:41:47', '2020-12-18 15:41:47', 'Ne optereƒáujte previ≈°e tricepse tijekom vje≈æbanja sa strojem za ƒçekiƒá. Takoƒëer izbjegavajte zakljuƒçavanje laktova na vrhu dizala i potrudite se odr≈æavati jednaku silu u obje ruke dok di≈æete.', 'Sprava za ƒçeliƒçnu snagu', '', 'publish', 'closed', 'closed', '', 'sprava-za-celicnu-snagu', '', '', '2021-01-18 15:34:39', '2021-01-18 14:34:39', '', 0, 'http://localhost/achilles_gym/?post_type=sprava&#038;p=25', 0, 'sprava', '', 0),
