(27, 1, '2020-12-18 16:43:20', '2020-12-18 15:43:20', 'Kada radite vje≈æbe na strojevima s kabelima i remenicama, va≈æno je koristiti pravu koliƒçinu utega. Premalo kilograma i neƒáete uƒçinkovito raditi, previ≈°e i opteretit ƒáete mi≈°iƒáe, mo≈æda ƒçak i dovesti do ozljeda.\r\n\r\nPostoji mnogo razliƒçitih vrsta vje≈æbi koje vam ovaj stroj mo≈æe pru≈æiti. Kao ≈°to je tisak, koji utjeƒçe na va≈°e pecs, ramena i triceps; zatim je kri≈æ s jednom rukom koji takoƒëer utjeƒçe na pecs i ramena, ali i na biceps.\r\n\r\nRazliƒçite vrste vje≈æbi koje mo≈æete raditi s kablovima ƒçine ga jednom od najsna≈ænijih teretanskih opreme gdje god da idete.', 'Kablovi i ramenice', '', 'publish', 'closed', 'closed', '', 'kablovi-i-ramenice', '', '', '2021-01-18 15:34:29', '2021-01-18 14:34:29', '', 0, 'http://localhost/achilles_gym/?post_type=sprava&#038;p=27', 0, 'sprava', '', 0),
(28, 1, '2020-12-18 16:43:10', '2020-12-18 15:43:10', '', 'CABLES-AND-PULLEYS', '', 'inherit', 'open', 'closed', '', 'cables-and-pulleys', '', '', '2020-12-18 16:43:10', '2020-12-18 15:43:10', '', 27, 'http://localhost/achilles_gym/wp-content/uploads/2020/12/CABLES-AND-PULLEYS.png', 0, 'attachment', 'image/png', 0),
(29, 1, '2020-12-18 16:46:16', '2020-12-18 15:46:16', 'Buƒçice im puno idu na ruku, uglavnom su jeftine u usporedbi s drugom opremom. No ako se pravilno koriste, mogu ponuditi jednako toliko, ako ne i vi≈°e, nego neki od njihovih unosnijih teretanskih kolega.\r\n\r\nKada vje≈æbate s buƒçicama, poku≈°ajte ne zakljuƒçati laktove na kraju pokreta i nemojte forsirati posljednjih nekoliko ponavljanja ako nemate prijatelja ili prijatelja iz teretane da vas uoƒçe.\r\n\r\nBuƒçice uzrokuju rad drugih mi≈°iƒáa dok ciljate nekoliko primarnih; zbog odr≈æavanja ravnote≈æe va≈°eg tijela i svih stabilizirajuƒáih mi≈°iƒáa koji ulaze u igru.', 'Buƒçice', '', 'publish', 'closed', 'closed', '', 'bucice', '', '', '2021-01-18 15:34:16', '2021-01-18 14:34:16', '', 0, 'http://localhost/achilles_gym/?post_type=sprava&#038;p=29', 0, 'sprava', '', 0),
(30, 1, '2020-12-18 16:46:06', '2020-12-18 15:46:06', '', 'DUMBBELLS', '', 'inherit', 'open', 'closed', '', 'dumbbells', '', '', '2020-12-18 16:46:06', '2020-12-18 15:46:06', '', 29, 'http://localhost/achilles_gym/wp-content/uploads/2020/12/DUMBBELLS.png', 0, 'attachment', 'image/png', 0),
(31, 1, '2020-12-18 16:49:34', '2020-12-18 15:49:34', 'Pullups su VRLO zahtjevni, posebno za poƒçetnike. Zbog toga morate nauƒçiti svladati ih. Oni su zaista izvrstan i da vrlo zahtjevan trening za gornji dio tijela.\r\n\r\nDr≈æite pokrete vertikalno, poravnati i dovr≈°avajte dok izvlaƒçite. Nakon nekog vremena, ako postanete struƒçnjak za to, mo≈æete objesiti uteg oko struka za dodatni otpor.\r\n\r\nAko ste poƒçetnik, vjerojatno biste trebali zapoƒçeti sa strojem za izvlaƒçenje lat, koji ƒáe vam izgraditi mi≈°iƒáe i pripremiti ih za izvlaƒçenje.\r\n\r\nPogre≈°ke ukljuƒçuju: brzo izvoƒëenje vje≈æbe, nepotpuno kretanje, zamahivanje tijelom, savijanje trupa prema naprijed kako biste postigli pomoƒá mi≈°iƒáa prsa, savijanje koljena da biste dobili zamah.\r\n\r\nNapokon, nemojte potpuno ispru≈æiti ruke na kraju kretanja prema dolje.', '≈†ipka za podizanje', '', 'publish', 'closed', 'closed', '', 'sipka-za-podizanje', '', '', '2021-01-18 15:34:07', '2021-01-18 14:34:07', '', 0, 'http://localhost/achilles_gym/?post_type=sprava&#038;p=31', 0, 'sprava', '', 0),
(32, 1, '2020-12-18 16:49:28', '2020-12-18 15:49:28', '', 'PULLUP-BAR', '', 'inherit', 'open', 'closed', '', 'pullup-bar', '', '', '2020-12-18 16:49:28', '2020-12-18 15:49:28', '', 31, 'http://localhost/achilles_gym/wp-content/uploads/2020/12/PULLUP-BAR.png', 0, 'attachment', 'image/png', 0),
(33, 1, '2020-12-18 16:51:44', '2020-12-18 15:51:44', 'Izbjegavajte uvrtanje kukova i koljena dok pomiƒçete te≈æinu, posebno kada spu≈°tate te≈æinu do granice stroja. Izbjegavajte brze pokrete samo da biste dobili zamah, imajte na umu da je forma superiornija od svega ostalog u bodybuildingu.\r\n\r\nSavijanje i / ili istezanje stopala ne mijenja rad koji rade kvadricepsi', 'Sprava za pro≈°irenje nogu', '', 'publish', 'closed', 'closed', '', 'sprava-za-prosirenje-nogu', '', '', '2021-01-18 15:33:42', '2021-01-18 14:33:42', '', 0, 'http://localhost/achilles_gym/?post_type=sprava&#038;p=33', 0, 'sprava', '', 0),
