(35, 1, '2020-12-18 16:55:03', '2020-12-18 15:55:03', 'Sprava za savijanje nogu, neke od popularnijih vrsta vje≈æbi ukljuƒçuju: no≈æne prste unutra, no≈æne prste van, jednokrake, stojeƒáe jednostruke noge i sjedeƒáe.\r\n\r\nIspru≈æite koljena previ≈°e dok spu≈°tate te≈æinu, prebrzo di≈æite teg da biste dobili zamah, a takoƒëer i ne stavljanje koljena u ravninu s osi stroja neke su od najƒçe≈°ƒáih pogre≈°aka koje ljudi u teretani ƒçine ovim ma≈°ina za vje≈æbanje.\r\n\r\nZanimljivo je da je stroj za savijanje nogu, kako le≈æeƒái, tako i / ili stojeƒái, specifiƒçniji i sigurniji, ali jednako uƒçinkovit kao i mrtvo dizanje kada je rijeƒç o radu na tetivama.\r\n\r\nIako stroj za uvijanje nogu koristi manje te≈æine. S druge strane, mrtvo dizanje mo≈æe se ƒçiniti uƒçinkovitijim zbog dodatne te≈æine, ali to je zbog ostalih mi≈°iƒáa koji sudjeluju u izvoƒëenju mrtvog dizanja.', 'Sprava za savijanje nogu', '', 'publish', 'closed', 'closed', '', 'sprava-za-savijanje-nogu', '', '', '2021-01-16 22:25:17', '2021-01-16 21:25:17', '', 0, 'http://localhost/achilles_gym/?post_type=sprava&#038;p=35', 0, 'sprava', '', 0),
