(37, 1, '2020-12-18 16:57:29', '2020-12-18 15:57:29', 'Ovaj je stroj jednako dobar kao i stroj za ƒçuƒçanj ≈°to se tiƒçe izgradnje snage i razvoja mi≈°iƒáa, meƒëutim, dobar je za za≈°titu leƒëa, jer ga stroj (uz va≈°u pomoƒá) dr≈æi u polo≈æaju.\r\n\r\nUobiƒçajene pogre≈°ke ljubitelja fitnesa prilikom izvoƒëenja vje≈æbe pritiskanja nogu su podizanje kukova dok se te≈æina spu≈°ta. Takoƒëer, savjetuje se da ikada ne zakljuƒçavate koljena na vrhu pokreta, dok su vam noge potpuno ispru≈æene.\r\n\r\nNepotpuno i / ili pretjerano kretanje neƒáe rezultirati ni uƒçinkovitim treningom. Napokon, izbjegavajte koristiti previ≈°e ili premalo te≈æine i budite sigurni da gurate objema nogama podjednako.', 'Sprava za pritisak nogu', '', 'publish', 'closed', 'closed', '', 'sprava-za-pritisak-nogu', '', '', '2021-01-16 22:25:07', '2021-01-16 21:25:07', '', 0, 'http://localhost/achilles_gym/?post_type=sprava&#038;p=37', 0, 'sprava', '', 0),
