(39, 1, '2020-12-18 17:02:03', '2020-12-18 16:02:03', 'Pravilno izvr≈°enje podrazumijeva sjedenje savijenih koljena pod pravim kutom, s loptama stopala na osloncu za noge. Pete bi vam trebale biti slobodne dok vje≈æbate pomoƒáu aparata za tele.\r\n\r\nPodignite pete ≈°to je vi≈°e moguƒáe, gurajuƒái jastuƒçiƒáe na koljenima ≈°to je vi≈°e moguƒáe; jednom kad dosegnete vrhunac koliko visoko mo≈æete gurnuti, zadr≈æite ga tamo trenutak, a zatim polako spustite pete. Pazite da tijekom procesa di≈°ete prirodno.\r\n\r\nNe odskakujte bez dr≈æanja te≈æine pod svojom kontrolom i izbjegavajte skidanje jedne noge s oslonca za noge dok zavr≈°avate set prije druge. Prvo spustite uteg, a zatim uklonite stopala.', 'Teljenica', '', 'publish', 'closed', 'closed', '', 'teljenica', '', '', '2021-01-16 22:24:56', '2021-01-16 21:24:56', '', 0, 'http://localhost/achilles_gym/?post_type=sprava&#038;p=39', 0, 'sprava', '', 0),
