(41, 1, '2020-12-18 17:10:53', '2020-12-18 16:10:53', 'Kori≈°tenje sobnog biciklistiƒçkog bicikla na neki je naƒçin sliƒçno uobiƒçajenom biciklu, ali na druge naƒçine vrlo razliƒçito. ≈Ωelite biti sigurni da ostajete na sigurnom kako biste sprijeƒçili ozljede. Pravilna postavka i odr≈æavanje pravilne forme je kljuƒç za to.\r\n\r\nEvo nekoliko savjeta:\r\n\r\nPostavite se u sjedeƒái polo≈æaj i nagnite tijelo prema naprijed te uƒçvrstite upravljaƒç do toƒçke u kojoj vam odgovaraju\r\n≈Ωelite prilagoditi i svoje sjedalo. ≈Ωelite da vam noge budu malo savijene kad pedalirate. Dobro je pravilo da ako osjetite bol u prednjem dijelu koljena, podignite sjedalo i spustite ga ako osjeƒáate bol u stra≈ænjem dijelu koljena.\r\nProvjerite je li udaljenost izmeƒëu vas i upravljaƒça odgovarajuƒáa. Papuƒçica bi trebala biti ispod va≈°eg koljena kad je ruƒçica paralelna s tlom.', 'Unutarnji bickil', '', 'publish', 'closed', 'closed', '', 'unutarnji-bickil', '', '', '2021-01-16 22:23:55', '2021-01-16 21:23:55', '', 0, 'http://localhost/achilles_gym/?post_type=sprava&#038;p=41', 0, 'sprava', '', 0),
