(45, 1, '2020-12-18 17:18:50', '2020-12-18 16:18:50', '<h4>Mark Johnson</h4>\r\nOsobni trener i trener borilaƒçkih sportova (Fit Kickbox)\r\nNino je apsolvent na Kineziolo≈°kom fakultetu u Zagrebu smjer kondicijska priprema sporta≈°a.\r\nIza sebe ima dugu sportsku karijeru i desetak amaterskih meƒçeva od kojih su tri profesionalna.\r\nKao pravi sporta≈° svjestan je da su usponi i padovi sastavni dio svakog ≈æivotnog puta, ali ono ≈°to je najbitnije je ponovno ustati i  nikada ne odustati. U sportu i ≈æivotu mora≈° se znati boriti, a upravo je Nino taj koji te tome mo≈æe poduƒçiti.\r\nU Formi ƒáete ga pronaƒái u ulozi trenera grupnih programa Fit kickboxa,Tabate i Forma drilla kao i osobnog trenera borilaƒçkih sportova i kondicijskog trenera u teretani.', 'Mark Johnson', '', 'publish', 'closed', 'closed', '', 'mark-johnson', '', '', '2021-01-27 20:47:00', '2021-01-27 19:47:00', '', 0, 'http://localhost/achilles_gym/?post_type=trener&#038;p=45', 0, 'trener', '', 0),
