(48, 1, '2020-12-18 17:22:15', '2020-12-18 16:22:15', '<h4>Renata Sopek</h4>\r\nRenata Sopek svoju karijeru zapoƒçinje kao Bingo djevojka, odnosno hostesa. Njen daljnji anga≈æman na televiziji bio je kao voditeljica vremenske prognoze na RTL Televiziji.\r\nOd svojih poƒçetaka snimila je brojne reklame poput onih za Peugeot, Zvijezdu, Podravku‚Ä¶\r\nVoli se brinuti za svoje tijelo i zdravlje te je neko vrijeme vodila emisiju ‚ÄúU dobroj formi s Renatom Sopek‚Äù u kojoj je svakodnevno pokazivala vje≈æbe i svoje znanje fitnessa.\r\nGodine 2014. voditeljica je pokrenula web portal ‚ÄúUltraFit by Renata Sopek‚Äù. Na tomu portalu nalaze se vje≈æbe za sve dijelove tijela te za sve razine vje≈æbanja, od poƒçetnih do naprednih. \r\nVoditeljica objavljuje i recepte kako bi pratitelji uz vje≈æbe odr≈æavali i pravilnu prehranu. Neko vrijeme je vodila i emisiju istoimena naziva na RTL Televiziji.\r\nVoditeljica je vlasnica fitness centra, a radi i kao zumba fitness instruktorica.\r\nSa Sergejem Bijeliƒáem, 2015. godine otvorila je noƒáni klub ‚ÄúTeatar‚Äù na Zvonƒçacu u Splitu. Jedan od partnera je i Miljenko Gusiƒá, a interijer kluba uredila je ≈æena nogometa≈°a Vedrana Runje, Tihana. Dvije godine kasnije, 2017. dolazi do spora oko graƒëevinske dozvole na mjestu gdje je klub izgraƒëen.\r\nKao fitness trenerica i instruktorica, voditeljica je stalni ambasador svih dogaƒëanja u vezi sa zdravim prehrambenih navikama i tjelovje≈æbama.\r\nKao studentica primila je vi≈°e dekanovih nagrada za svoj trud i rezultate, uzev≈°i u obzir da paralelno radi i redovno pohaƒëa nastavu i rje≈°ava ispite.', 'Renata Sopek', '', 'publish', 'closed', 'closed', '', 'renata-sopek', '', '', '2021-01-27 20:46:52', '2021-01-27 19:46:52', '', 0, 'http://localhost/achilles_gym/?post_type=trener&#038;p=48', 0, 'trener', '', 0),
