(56, 1, '2020-12-18 17:33:57', '2020-12-18 16:33:57', '<h4>Chris Chan</h4>\r\nRoƒëen u Pohangu u Ju≈ænoj Koreji 1987. godine, Jung se preselio u Namyangju, satelitski grad Seul kada je bio u srednjim godinama. \r\nJung je trenirao kickboxing do svoje srednje ≈°kole. Diplomirao je na Daegu Gyeongbuk institutu za znanost i tehnologiju. Kasnije je takoƒëer poƒçeo trenirati judo i brazilsku jiu jitsu.\r\nU dobi od 18 godina, Jung se pridru≈æio mornarici Ju≈æne Koreje i poƒçeo trenirati taekwondo. [5] U lipnju 2007. pobijedio je na turniru u sambu koji je organiziralo Korejsko udru≈æenje samboa,\r\na u prosincu iste godine pobijedio je u lakoj kategoriji Pancrase Korea Neo-Blood turnira nakon ≈°to je pobijedio Ju≈ænokorejace Yoo In Seok i Lee Hyung Geol.\r\nU dobi od 20 godina Jung je zapoƒçeo mje≈°ovite borilaƒçke vje≈°tine i ubrzo nakon toga debitirao u profesionalnoj karijeri. U svibnju 2008. sudjelovao je i osvojio KOREA-FC-ov MMA turnir sa 8 osoba u diviziji do 65 kilograma.\r\nJung je takoƒëer bio sudionik emisije pod nazivom Street Fighter 2007. koja se emitirala na ju≈ænokorejskoj kabelskoj televiziji. Sudjelovao je na turniru do 70 kg i pobijedio.\r\nTurnir je bio samo stand-up (sliƒçan K-1, ali ne u ringu).', 'Chris Chan', '', 'publish', 'closed', 'closed', '', 'chris-chan', '', '', '2021-01-27 20:48:02', '2021-01-27 19:48:02', '', 0, 'http://localhost/achilles_gym/?post_type=trener&#038;p=56', 0, 'trener', '', 0),
