(161, 1, '2021-01-18 16:23:01', '2021-01-18 15:23:01', '<!-- wp:paragraph -->\n<p><p style=\"font-size: 20px;\n    margin: 50px 0;\n    text-align: center;\">Achilles Gym fitness klubovi namijenjeni su svima kojima je stalo do zdravog naƒçina ≈æivota i ukljuƒçuju vje≈æbanje kao dio svakodnevnog ≈æivota, bilo da su rekreativci i poƒçetnici ili sporta≈°i i ljudi koji veƒá dugo vje≈æbaju.</p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><p style=\"font-size: 20px;\n    margin: 50px 0;\n    text-align: center;\">Bez obzira ≈°to tra≈æite u teretani, za vas imamo moguƒánost & nbsp; ƒçlanstva. Svi ƒçlanovi Achilles Gym u≈æivaju neograniƒçen pristup svom matiƒçnom klubu i podr≈°ku na≈°eg ljubaznog, struƒçnog osoblja kad god vam zatreba. ƒålanovi PF Black Card¬Æ-a dobivaju dodatne pogodnosti, ukljuƒçujuƒái moguƒánost besplatnog dovoƒëenja gosta i pristup bilo kojem od na≈°ih 2000+ PF lokacija.</p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><p style=\"font-size: 20px;\n    margin: 50px 0;\n    text-align: center;\">Tra≈æite li malo dodatnih smjernica ili nadahnuƒáa koji ƒáe vam pomoƒái da postignete svoje kondicijske ciljeve? Kao ƒçlan PF-a mo≈æete iskoristiti na≈°e&nbsp;<a href=\"https://www.planetfitness.com/about-planet-fitness/pe-pf\">free fitness training</a>&nbsp;ili pronaƒëite svoju motivaciju ƒçitajuƒái stvarna iskustva ƒçlanova on&nbsp;<a href=\"https://planetoftriumphs.com/\" target=\"_blank\" rel=\"noreferrer noopener\">Planet of Triumphs.</a></p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><p style=\"font-size: 20px;\n    margin: 50px 0;\n    text-align: center;\">Cilj nam je pru≈æiti ƒçisto, sigurno, ugodno okru≈æenje za svakoga tko uƒëe kroz na≈°a vrata i svu opremu, sadr≈æaje i podr≈°ku koja vam je potrebna kad ste ovdje.</p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><p style=\"font-size: 20px;\n    margin: 50px 0;\n    text-align: center;\"><strong>Dobrodo≈°li u Achilles Gym.&nbsp;Slobodna zona presude¬Æ</strong></p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"glavniNaslov\"} -->\n<p class=\"glavniNaslov\">UVIJEK PRVI</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"sporedniNaslov\"} -->\n<p class=\"sporedniNaslov\">OTVORENI SMO - 24/7</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"textONama\"} -->\n<p class=\"textONama\">Achilles Gym klubovi rade bez prestanka, svih 7 dana u tjednu, od 0 do 24 sata, tako da svi na≈°i ƒçlanovi imaju priliku vje≈æbati u bilo koje doba dana i noƒái, ovisno o njihovom afinitetu i slobodnom vremenu</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"sporedniNaslov\"} -->\n<p class=\"sporedniNaslov\">POVOLJNE CIJENE</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"textONama\"} -->\n<p class=\"textONama\">Kako bi svi imali priliku trenirati u najboljim uvjetima, na≈°a su ƒçlanstva dostupna po povoljnim cijenama</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"sporedniNaslov\"} -->\n<p class=\"sporedniNaslov\">ƒåLANSKA KARTICA DAJE PRISTUP SVIM LOKACIJAMA.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"textONama\"} -->\n<p class=\"textONama\">Jedna ƒçlanska iskaznica vrijedi za sve lokacije. Svaki ƒçlan dobiva osobnu, jedinstvenu ƒçlansku iskaznicu koja vrijedi za sve postojeƒáe i buduƒáe lokacije Achillies Gym.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"glavniNaslov\"} -->\n<p class=\"glavniNaslov\">UVIJEK BOLJE</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"sporedniNaslov\"} -->\n<p class=\"sporedniNaslov\">VRHUNSKI I KVALIFICIRANI TRENERI</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"textONama\"} -->\n<p class=\"textONama\">Na≈°i treneri imaju dugogodi≈°nje iskustvo i spremni su se prilagoditi va≈°im kondicijskim ciljevima</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"sporedniNaslov\"} -->\n<p class=\"sporedniNaslov\">INDIVIDUALNI TRENING</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"textONama\"} -->\n<p class=\"textONama\">Na≈°i treneri ƒáe stvoriti program koji odgovara samo va≈°im potrebama\n</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"sporedniNaslov\"} -->\n<p class=\"sporedniNaslov\">BESPLATNO PROBNO OBUƒåAVANJE</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"textONama\"} -->\n<p class=\"textONama\">Na≈°im novim ƒçlanovima takoƒëer nudimo priliku da se upoznaju s opremom koja ukljuƒçuje savjetovanje osobnih trenera.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><p style=\"font-size: 42px;\n    margin-top: 50px;\n    text-align: center;\"=\"\">Potra≈æite nas!</p></p>\n<!-- /wp:paragraph -->\n\n<div id=\"map\" style=\"height: 350px;\n    width: 80%;\n    margin: 0 auto;\n    margin-top: 50px;\"></div>', 'O nama', '', 'inherit', 'closed', 'closed', '', '102-revision-v1', '', '', '2021-01-18 16:23:01', '2021-01-18 15:23:01', '', 102, 'http://localhost/achilles_gym/?p=161', 0, 'revision', '', 0),
(164, 1, '2021-01-23 16:03:33', '2021-01-23 15:03:33', 'Kad se mozak prebaci na stresan naƒçin rada, sposobnost razmi≈°ljanja i rje≈°avanja problema se drastiƒçno smanjuje.\r\nKako biste izbjegli ovakve situacije, evo ≈°to mo≈æete napraviti:\r\n\r\nUsredotoƒçite se na dragu vam sliku. Zamislite zalazak sunca, juƒçera≈°nju ≈°etnju s voljenom osobom, prve korake svog djeteta. Prisjetite se omiljenog trenutka sreƒáe i poku≈°ajte ≈°to du≈æe zadr≈æati tu sliku.\r\nZatvorite oƒçi ili usredotoƒçite pogled na ruke polo≈æene na tastaturi. Zatim udahnite, potiho brojeƒái u sebi do ƒçetiri. Napravite stanku, a zatim izdahnite brojeƒái od ƒçetiri. Ovu vje≈æbu napravite barem 10 puta.\r\nZamislite kako vas obasjavaju zlatne zrake sunca. Te vas zrake ≈°tite i nje≈æno miluju. Takoƒëer, mo≈æete zamisliti i lica voljenih osoba kako vas ≈°tite. Ovu sliku zadr≈æite koliko god vam odgovara.\r\nNazovite osobi koja vas voli i podr≈æava. Uvijek je dobro imati osobu koja ƒáe nas poslu≈°ati i pru≈æiti nam podr≈°ku.\r\nZamislite ne≈°to smije≈°no ili pogledajte ne≈°to ≈°aljivo na internetu. Opustite se i nasmijte nekoliko minuta. Smijeh uvijek poma≈æe, ƒçak i kada vam se ≈æivot ƒçini preozbiljnim.\r\nZatvorite oƒçi ili usredotoƒçite pogled na ruke polo≈æene na tastaturi. Zatim udahnite, potiho brojeƒái u sebi do ƒçetiri. Napravite stanku, a zatim izdahnite brojeƒái od ƒçetiri. Ovu vje≈æbu napravite barem 10 puta.\r\nZamislite kako vas obasjavaju zlatne zrake sunca. Te vas zrake ≈°tite i nje≈æno miluju. Takoƒëer, mo≈æete zamisliti i lica voljenih osoba kako vas ≈°tite. Ovu sliku zadr≈æite koliko god vam odgovara.\r\n\r\n', 'Ubla≈æavanje stresa', '', 'publish', 'closed', 'closed', '', '5-nacina-za-ublazavanje-stresa', '', '', '2021-01-28 17:17:14', '2021-01-28 16:17:14', '', 0, 'http://localhost/achilles_gym/?post_type=zanimljivost&#038;p=164', 0, 'zanimljivost', '', 0),
