(172, 1, '2021-01-25 17:06:56', '2021-01-25 16:06:56', '<p>Vje≈æbe za noge, bez obzira na to ≈°to odaberete, ispunjavaju sa strepnjom ƒçak i najzanesenijeg posjetitelja teretane i to s dobrim razlogom.\nRazdoblje oporavka je du≈æe i bolnije.\nRezultati, koji se sporo ostvaruju, kratkoroƒçno nisu toliko zadovoljavajuƒái.\nBuduƒái da ƒçesto regrutiraju vi≈°e mi≈°iƒáa, vje≈æbe za noge mogu biti oporeziva od veƒáine pokreta gornjeg dijela tijela.\nA kad vam se ƒçini da kotaƒçi napokon narastu, skriveni su pod trapericama 90% godine. Sjajno.</p>\n', 'Noge - Ahilejski', '', 'inherit', 'closed', 'closed', '', '151-autosave-v1', '', '', '2021-01-25 17:06:56', '2021-01-25 16:06:56', '', 151, 'http://localhost/achilles_gym/?p=172', 0, 'revision', '', 0),
