(175, 1, '2021-01-26 16:49:57', '2021-01-26 15:49:57', 'Mnogi ljudi koriste tjelovje≈æbu kao svoju jedinu metodu upravljanja tjelesnom te≈æinom, meƒëutim studije su pokazale da vje≈æbanje, ako se ne kombinira s prehrambenim promjenama, jako malo utjeƒçe na gubitak kilograma.\r\nStudija objavljena u The British Journal of Sports Medicine otkrila je da kada skupina pretilih ljudi odradi 12 tjedana nadziranih kardio treninga bez dijeta, veƒáina nije do≈æivjela znaƒçajnije rezultate gubitka kilograma.\r\nMeƒëutim, va≈æno je zapamtiti da, iako to samo po sebi ne mo≈æe dovesti do gubitka kilograma, vje≈æbanje jo≈° uvijek ima puno drugih zdravstvenih blagodati.\r\nEvo 10 savjeta kako izgubiti na te≈æini:\r\n1. Ne preskaƒçite doruƒçak\r\n2. Jedite redovite obroke\r\n3. Jedite puno voƒáa i povrƒáa\r\n4. Postanite aktivniji\r\n5. Pijte puno vode\r\n6. Jedite hranu bogatu vlaknima\r\n7. Proƒçitajte naljepnice s hranom\r\n8. Koristite manji tanjur\r\n9. Ne zabranjujte hranu\r\n10. Nemojte skladi≈°titi bezvrijednu hranu', 'Mr≈°avljenje?', '', 'publish', 'closed', 'closed', '', 'test1', '', '', '2021-01-27 20:07:33', '2021-01-27 19:07:33', '', 0, 'http://localhost/achilles_gym/?post_type=zanimljivost&#038;p=175', 0, 'zanimljivost', '', 0),
(176, 1, '2021-01-26 16:50:06', '2021-01-26 15:50:06', '1. Je li vam bolji trening ujutro?\r\nTrebali biste vje≈æbati u vrijeme koje odgovara vama i va≈°em tijelu. Nema dokaza koji upuƒáuju na to da je rani jutarnji trening bolji za vas, ali neki su ljudi u ovom trenutku jednostavno uƒçinkovitiji. Dobit ƒáete rezultate bez obzira na doba dana, sve dok to vama odgovara.\r\n2. Trebam li pristupiti svojim sesijama s planom?\r\nDa, ovo ƒáe vam pomoƒái da na najbolji naƒçin iskoristite svoj trening. Odluƒçite na kojim mi≈°iƒánim skupinama ≈æelite raditi, radite li seansu ili HIIT trening i koju ƒáete opremu trebati. Zatim razmislite koliko ponavljanja i setova ƒáete izvesti. Na taj naƒçin neƒáete gubiti vrijeme na odgaƒëanje i kao rezultat toga vi≈°e ƒáete raditi.\r\n3. Trebam li vje≈æbati svaki dan?\r\nDobar tjedan treninga ne mora znaƒçiti i trening svaki dan. Tri do ƒçetiri treninga u teretani ili kuƒái svaki tjedan dovoljni su ako se maksimalno trudite u svakoj seansi. Poku≈°ajte uravnote≈æiti tjedan kombinacijom kardio, HIIT-a, snage i joge ili pilatesa. Meƒëutim, ≈°to se tiƒçe aktivnosti, trebali biste te≈æiti svakodnevnom kretanju ≈°to je vi≈°e moguƒáe - bilo da se radi o brzom hodanju, trƒçanju, plivanju, vrtlarenju ili stavljanju svega u kuƒáanske poslove!\r\n4. Koliko dugo trebam vje≈æbati?\r\nTo ovisi o razini va≈°e kondicije, vrsti treninga i intenzitetu treninga. Samo zapamtite, uvijek je ne≈°to bolje nego ni≈°ta. Ako imate samo 30 minuta, poku≈°ajte se uklopiti u brzi HIIT (High Intensity Interval Training) trening ili idite na trƒçanje.\r\nAko radite trening snage, odvojite vi≈°e vremena za zagrijavanje i mobilizaciju kako biste izbjegli ozljede i osigurali dovoljno odmora izmeƒëu setova. U svakom sluƒçaju, to definitivno ne trebate progovarati satima!\r\n', 'ƒåesta pitanja', '', 'publish', 'closed', 'closed', '', 'test2', '', '', '2021-01-28 17:16:47', '2021-01-28 16:16:47', '', 0, 'http://localhost/achilles_gym/?post_type=zanimljivost&#038;p=176', 0, 'zanimljivost', '', 0),
(177, 1, '2021-01-26 16:50:13', '2021-01-26 15:50:13', 'Ne osjeƒáajuƒái opekline\r\nƒåe≈°ƒáe poznata kao \"nedovoljna treniranost\", nenapu≈°tanje (tj. Osjeƒáaj opeklina) lo≈°a je navika koja vje≈æbanje mo≈æe uƒçiniti daleko manje uƒçinkovitim kao ≈°to bi inaƒçe moglo biti. Nedovoljna treniranost mo≈æe ukljuƒçiti lo≈°u formulu ili dr≈æanje tijela na raznim vje≈æbama ili prolaz kroz ponavljanje tako brzo da va≈°i mi≈°iƒái nisu pravilno izazvani.\r\nPretjerivanje\r\nS druge strane, meƒëutim, mnogi ljubitelji vje≈æbanja misle ako je dobro razraditi ne≈°to, bolje je ODR≈ΩATI VI≈†E. To nije uvijek sluƒçaj. Poznato kao \"pretreniranost\", predavanje previ≈°e aktivnostima mo≈æe rezultirati izvuƒçenim mi≈°iƒáima i nesreƒáama u teretani. Kako biste bili sigurni da ne pretjerujete, slu≈°ajte svoje tijelo i poku≈°ajte uravnote≈æiti gumption kako biste se pobolj≈°ali sa zdravim oprezom.\r\nNe zagrijavanje\r\nOvo je vjerojatno najƒçe≈°ƒáa lo≈°a navika u teretani - uostalom, osjeƒáate se dobro prije nego ≈°to vje≈æbate i ƒçesto nakon toga ne osjeƒáate bol. (Dva dana kasnije mo≈æe biti i druga priƒça.) Ali rutina zagrijavanja bitna je kad pripremate tijelo za trening. Proƒëite kroz ƒçitav raspon pokreta za svaku mi≈°iƒánu skupinu i prije i nakon vje≈æbanja. To ƒáe va≈°em tijelu pru≈æiti najbolje ≈°anse za dobro zdravlje tijekom treninga i dobar osjeƒáaj nakon njega.\r\nNe pije dovoljno vode\r\nPostoji razlog za≈°to su fontane tako ƒçeste u teretanama. Postati dehidrirani glavni je problem vje≈æbaƒça - posebno onih koji se bave posebno zahtjevnim treninzima. Dok se znojimo, na≈°e tijelo odbacuje toksine i hladi se znojem. Ako ne uspijemo nadoknaditi tjelesnu vodu (i sjetite se, ljudska tijela imaju preko 50 posto vode!), Riskiramo letargiju, ≈æeƒë, vrtoglavicu i nesreƒáe.\r\nNe jedete dovoljno\r\nLjudi koji vje≈æbaju kako bi smr≈°avili mogu ga smatrati kontraintuitivnim, ali post prije treninga zapravo mo≈æe dovesti do debljanja - zbog niskog ≈°eƒáera u krvi osjeƒáate se tromo, ≈°to mo≈æe dovesti do manje intenzivne i kraƒáe seanse.', 'Lo≈°e navike', '', 'publish', 'closed', 'closed', '', 'test3', '', '', '2021-01-27 20:07:46', '2021-01-27 19:07:46', '', 0, 'http://localhost/achilles_gym/?post_type=zanimljivost&#038;p=177', 0, 'zanimljivost', '', 0),
(178, 1, '2021-01-26 18:46:20', '2021-01-26 17:46:20', '<!-- wp:paragraph -->\n<p><p style=\"font-size: 20px;\n    margin: 50px 0;\n    text-align: center;\">Achilles Gym fitness klubovi namijenjeni su svima kojima je stalo do zdravog naƒçina ≈æivota i ukljuƒçuju vje≈æbanje kao dio svakodnevnog ≈æivota, bilo da su rekreativci i poƒçetnici ili sporta≈°i i ljudi koji veƒá dugo vje≈æbaju.</p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><p style=\"font-size: 20px;\n    margin: 50px 0;\n    text-align: center;\">Bez obzira ≈°to tra≈æite u teretani, za vas imamo moguƒánost & nbsp; ƒçlanstva. Svi ƒçlanovi Achilles Gym u≈æivaju neograniƒçen pristup svom matiƒçnom klubu i podr≈°ku na≈°eg ljubaznog, struƒçnog osoblja kad god vam zatreba. ƒålanovi PF Black Card¬Æ-a dobivaju dodatne pogodnosti, ukljuƒçujuƒái moguƒánost besplatnog dovoƒëenja gosta i pristup bilo kojem od na≈°ih 2000+ PF lokacija.</p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><p style=\"font-size: 20px;\n    margin: 50px 0;\n    text-align: center;\">Tra≈æite li malo dodatnih smjernica ili nadahnuƒáa koji ƒáe vam pomoƒái da postignete svoje kondicijske ciljeve? Kao ƒçlan PF-a mo≈æete iskoristiti na≈°e&nbsp;<a href=\"https://www.planetfitness.com/about-planet-fitness/pe-pf\">free fitness training</a>&nbsp;ili pronaƒëite svoju motivaciju ƒçitajuƒái stvarna iskustva ƒçlanova on&nbsp;<a href=\"https://planetoftriumphs.com/\" target=\"_blank\" rel=\"noreferrer noopener\">Planet of Triumphs.</a></p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><p style=\"font-size: 20px;\n    margin: 50px 0;\n    text-align: center;\">Cilj nam je pru≈æiti ƒçisto, sigurno, ugodno okru≈æenje za svakoga tko uƒëe kroz na≈°a vrata i svu opremu, sadr≈æaje i podr≈°ku koja vam je potrebna kad ste ovdje.</p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><p style=\"font-size: 20px;\n    margin: 50px 0;\n    text-align: center;\"><strong>Dobrodo≈°li u Achilles Gym.&nbsp;Slobodna zona presude¬Æ</strong></p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"glavniNaslov\"} -->\n<p class=\"glavniNaslov\">UVIJEK PRVI</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"sporedniNaslov\"} -->\n<p class=\"sporedniNaslov\">OTVORENI SMO - 24/7</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"textONama\"} -->\n<p class=\"textONama\">Achilles Gym klubovi rade bez prestanka, svih 7 dana u tjednu, od 0 do 24 sata, tako da svi na≈°i ƒçlanovi imaju priliku vje≈æbati u bilo koje doba dana i noƒái, ovisno o njihovom afinitetu i slobodnom vremenu</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"sporedniNaslov\"} -->\n<p class=\"sporedniNaslov\">POVOLJNE CIJENE</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"textONama\"} -->\n<p class=\"textONama\">Kako bi svi imali priliku trenirati u najboljim uvjetima, na≈°a su ƒçlanstva dostupna po povoljnim cijenama</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"sporedniNaslov\"} -->\n<p class=\"sporedniNaslov\">ƒåLANSKA KARTICA DAJE PRISTUP SVIM LOKACIJAMA.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"textONama\"} -->\n<p class=\"textONama\">Jedna ƒçlanska iskaznica vrijedi za sve lokacije. Svaki ƒçlan dobiva osobnu, jedinstvenu ƒçlansku iskaznicu koja vrijedi za sve postojeƒáe i buduƒáe lokacije Achillies Gym.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"glavniNaslov\"} -->\n<p class=\"glavniNaslov\">UVIJEK BOLJE</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"sporedniNaslov\"} -->\n<p class=\"sporedniNaslov\">VRHUNSKI I KVALIFICIRANI TRENERI</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"textONama\"} -->\n<p class=\"textONama\">Na≈°i treneri imaju dugogodi≈°nje iskustvo i spremni su se prilagoditi va≈°im kondicijskim ciljevima</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"sporedniNaslov\"} -->\n<p class=\"sporedniNaslov\">INDIVIDUALNI TRENING</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"textONama\"} -->\n<p class=\"textONama\">Na≈°i treneri ƒáe stvoriti program koji odgovara samo va≈°im potrebama\n</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"sporedniNaslov\"} -->\n<p class=\"sporedniNaslov\">BESPLATNO PROBNO OBUƒåAVANJE</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"textONama\"} -->\n<p class=\"textONama\">Na≈°im novim ƒçlanovima takoƒëer nudimo priliku da se upoznaju s opremom koja ukljuƒçuje savjetovanje osobnih trenera.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><p style=\"font-size: 42px;\n    margin-top: 50px;\n    text-align: center;\"=\"\">Potra≈æite nas!</p></p>\n<!-- /wp:paragraph -->', 'O nama', '', 'inherit', 'closed', 'closed', '', '102-revision-v1', '', '', '2021-01-26 18:46:20', '2021-01-26 17:46:20', '', 102, 'http://localhost/achilles_gym/?p=178', 0, 'revision', '', 0),
(179, 1, '2021-01-27 14:40:53', '2021-01-27 13:40:53', 'Mnogi ljudi koriste tjelovje≈æbu kao svoju jedinu metodu upravljanja tjelesnom te≈æinom, meƒëutim studije su pokazale da vje≈æbanje, ako se ne kombinira s prehrambenim promjenama, jako malo utjeƒçe na gubitak kilograma. Studija objavljena u The British Journal of Sports Medicine otkrila je da kada skupina pretilih ljudi odradi 12 tjedana nadziranih kardio treninga bez dijeta, veƒáina nije do≈æivjela znaƒçajnije rezultate gubitka kilograma. Meƒëutim, va≈æno je zapamtiti da, iako to samo po sebi ne mo≈æe dovesti do gubitka kilograma, vje≈æbanje jo≈° uvijek ima puno drugih zdravstvenih blagodati.', 'Vje≈æba vas neƒáe uƒçiniti tankim', '', 'inherit', 'closed', 'closed', '', '175-autosave-v1', '', '', '2021-01-27 14:40:53', '2021-01-27 13:40:53', '', 175, 'http://localhost/achilles_gym/?p=179', 0, 'revision', '', 0),
